    font-family: "Roboto", "Helvetica", "Arial", sans-serif;
    font-size: 20px;
    font-weight: 600;;
    text-transform: uppercase;
    text-align: center;
    color: #424242;
    margin: 30px 30px 8px 30px;

`;

class HomePage extends Component {
    render() {
        return (
            <HomePageStyled>
                <Heahing>Top rated</Heahing>
                <Card />
            </HomePageStyled>
        )
    }
}

